import {
  UilEstate,
  UilClipboardAlt,
  UilUsersAlt,
  UilPackage,
  UilChart,
  UilUsdSquare,
} from '@iconscout/react-unicons';

export const SidebarData = [
  {
    icon: UilEstate,
    heading: 'Dashboard',
  },
  {
    icon: UilClipboardAlt,
    heading: 'Orders',
  },
  {
    icon: UilUsersAlt,
    heading: 'Customers',
  },
  {
    icon: UilPackage,
    heading: 'Products',
  },
  {
    icon: UilChart,
    heading: 'Analysis',
  },
];

export const CardsData = [
  {
    title: 'sales',
    color: {
      background: 'linear-gradient(180deg,#bb67ff,#c484f3,100%)',
      boxshadow: '0px 10px 20px 0px #e0c6f5',
    },
    barValue: 70,
    value: '25,970',
    png: UilUsdSquare,
    series: [
      {
        name: 'sales',
        dara: [31, 40, 28, 51, 42, 109, 100],
      },
    ],
  },
];
